import React from "react";

const TodoApp = () => {
  return (
    <div style={{ backgroundColor: "red", height: window.innerHeight }}>
      <div>
        <h1>Todo App</h1>
      </div>
      <div
        style={{
          zIndex: -1,
          height: 200,
          width: 400,
          backgroundColor: "green",
          marginLeft: "600px",
          marginTop: "200px"
          //   padding: "400px 0px 0px 600px"
        }}
      >
        Hello World
      </div>
    </div>
  );
};

export default TodoApp;
